using namespace std; 
 
bool isprime(int x) 
{ 
  if( x==0 || x==1 ) return false; 
  if(x==2) return true; 
  if(x%2==0) return false; 
  for(int i=3;i<=x/2;i+=2) 
    if(x%i == 0 )  
      return false; 
 
  return true; 
} 
class MagicStonesStore 
{ 
  public : 
  string ableToDivide(int n) 
  { 
    n*=2; 
    for(int i=1;i<=n;i++) 
    { 
      if(isprime(i) && isprime(n-i)) 
        return "YES"; 
    } 
    return "NO"; 
  } 
}; 
